var canvas, img;
function setup() {
  canvas = createCanvas(windowWidth, windowHeight);
  background("#eee");
  noStroke();
  fill('yellow');
  rect(0, 120, windowWidth, windowHeight);

  textSize(14);
  textAlign(LEFT, TOP);
  fill('black');
  text('图片', 20, 25);
  input = createFileInput(handleFile);
  input.position(60, 20);
  function handleFile(file) {
    if (file.type === 'image') {
      img = createImg(file.data, '');
      Lab.ai.getColor(img);
      img.hide();
    } else {
      img = null;
    }
  }

  text('字体', 20, 55);
  input2 = createFileInput(handleFile2);
  input2.position(60, 50);
  function handleFile2(file) {
    textFont(
      loadFont(URL.createObjectURL(file.file))
    );
  }

  button = createButton('下载');
  button.position(20, 90);
  button.mousePressed(downCanvas);
  function downCanvas() {
    saveCanvas(Lab.ai.cropCanvas(canvas, 0, 120, windowWidth, windowHeight - 120), '01', 'jpg');
  }
}

function draw() {
  if (img && img.mainColor) background(img.mainColor.toString());
  if (img) image(img, 0, 120, width, width * img.height / img.width);

  textSize(24)
  text("智能设计：标题", 10, height * 0.85)
  textSize(14)
  text("副标题", 12, height * 0.85 + 24)
}
